Implement the following functions:
1. `malloc(size_t size)`: Allocate a block of memory of `size` bytes and return a pointer to the beginning of the block. If the allocation fails, return `NULL`.
2. `calloc(size_t num, size_t size)`: Allocate an array of `num` elements, each of size `size` bytes, and return a pointer to the beginning of the array. If the allocation fails, return `NULL`.
3. `realloc(void* ptr, size_t size)`: Change the size of the block of memory pointed to by `ptr` to `size` bytes. If the allocation fails, return `NULL`. If `ptr` is `NULL`, behave as if `malloc(size)` was called instead.

Here is a sample implementation in C:
```c
#include <stdlib.h>
#include <stdio.h>

// Structure to represent a block of memory
typedef struct {
    size_t size; // size of the block in bytes
    struct block* next; // next block in the free list
} block;

// Global variable to keep track of the free list
block* free_list = NULL;

// Function to allocate a block of memory
void* malloc(size_t size) {
    block* new_block = (block*)malloc(sizeof(block));
    new_block->size = size;
    new_block->next = free_list;
    free_list = new_block;
    return (void*)new_block + sizeof(block);
}

// Function to allocate an array of elements
void* calloc(size_t num, size_t size) {
    size_t total_size = num * size;
    void* ptr = malloc(total_size);
    if (ptr == NULL) return NULL;
    memset(ptr, 0, total_size);
    return ptr;
}

// Function to change the size of a block of memory
void* realloc(void* ptr, size_t size) {
    if (ptr == NULL) {
        return malloc(size);
    }
    block* block_ptr = (block*)ptr - sizeof(block);
    size_t old_size = block_ptr->size;
    if (size <= old_size) {
        return ptr;
    }
    block* new_block = (block*)malloc(size);
    new_block->size = size;
    new_block->next = block_ptr->next;
    block_ptr->next = new_block;
    return (void*)new_block + sizeof(block);
}

